func (p *WlPointer) OnRequest(s FileDescriptorClaimClientState, message Message) {
	_data_in_offset__ := 0
	_ = _data_in_offset__
	d := p.Delegate
	switch message.Opcode {
	case 0:
		{

			serial := uint32(message.Data[_data_in_offset__+0]) | uint32(message.Data[_data_in_offset__+1])<<8 |
				uint32(message.Data[_data_in_offset__+2])<<16 | uint32(message.Data[_data_in_offset__+3])<<24
			_data_in_offset__ += 4

			surfaceTmp := uint32(message.Data[_data_in_offset__+0]) | uint32(message.Data[_data_in_offset__+1])<<8 |
				uint32(message.Data[_data_in_offset__+2])<<16 | uint32(message.Data[_data_in_offset__+3])<<24
			_data_in_offset__ += 4
			var surface *ObjectID[WlSurface]
			if surfaceTmp != 0 {
				tmp := ObjectID[WlSurface](surfaceTmp)
				surface = &tmp
			}

			hotspot_x := int32(uint32(message.Data[_data_in_offset__+0]) | uint32(message.Data[_data_in_offset__+1])<<8 |
				uint32(message.Data[_data_in_offset__+2])<<16 | uint32(message.Data[_data_in_offset__+3])<<24)
			_data_in_offset__ += 4

			hotspot_y := int32(uint32(message.Data[_data_in_offset__+0]) | uint32(message.Data[_data_in_offset__+1])<<8 |
				uint32(message.Data[_data_in_offset__+2])<<16 | uint32(message.Data[_data_in_offset__+3])<<24)
			_data_in_offset__ += 4

			if DebugRequests {
				fmt.Print("WlPointer@", message.ObjectID, ".set_cursor(")
				fmt.Println("serial: ", serial, ", ", "surface: ", surface, ", ", "hotspot_x: ", hotspot_x, ", ", "hotspot_y: ", hotspot_y, ")")
			}

			d.WlPointer_set_cursor(s, ObjectID[WlPointer](message.ObjectID), serial, surface, hotspot_x, hotspot_y)
			break
		}

	case 1:
		{

			if DebugRequests {
				fmt.Print("WlPointer@", message.ObjectID, ".release(")
				fmt.Println(")")
			}

			autoRemove := d.WlPointer_release(s, ObjectID[WlPointer](message.ObjectID))
			if autoRemove {
				s.RemoveObject(message.ObjectID)
				s.RemoveGlobalWlPointerBind(ObjectID[WlPointer](message.ObjectID))
			}
			break
		}

	default:
		fmt.Println("Unknown opcode on WlPointer", message.Opcode)
	}
}

